DROP TABLE IF EXISTS `acc_business_account`;
CREATE TABLE `acc_business_account` (
  `id` varchar(100) NOT NULL,
  `businessid` varchar(100) NOT NULL COMMENT 'B户客户号',
  `userid` char(36) NOT NULL COMMENT '外键：用户id',
  `businessname` varchar(300) NOT NULL COMMENT 'B户名称',
  `regioncode` char(6) NOT NULL COMMENT '行政区域编码',
  `regionname` text NOT NULL COMMENT '行政区域名称',
  `industrycode` char(5) NOT NULL COMMENT '国家行业分类代码',
  `industryname` text NOT NULL COMMENT '国家行业分类名称',
  `isdefault` int(11) NOT NULL COMMENT '是否运营公司，0-否；1-是',
  `businesslicense` text NOT NULL COMMENT '营业执照图片',
  `name` varchar(300) NOT NULL COMMENT '法人姓名',
  `certtype` varchar(200) NOT NULL COMMENT '法人证件类型',
  `certno` varchar(100) NOT NULL COMMENT '法人证件号码',
  `certpicture` text NOT NULL COMMENT '证件图片',
  `telephone` varchar(200) NOT NULL COMMENT '预留电话号码',
  `bankaccount` varchar(200) DEFAULT NULL COMMENT '对公账户号',
  `accountname` varchar(300) DEFAULT NULL COMMENT '对公账户名称',
  `bank` varchar(300) DEFAULT NULL COMMENT '开户行',
  `createdate` varchar(30) NOT NULL COMMENT '创建时间',
  `creator` varchar(200) NOT NULL COMMENT '创建人',
  `custid` varchar(200) DEFAULT NULL COMMENT 'C户客户号',
  `businesskey` varchar(100) DEFAULT NULL COMMENT 'B户安全校验key',
  `publickey` text COMMENT 'B户公钥',
  `channel` varchar(100) NOT NULL COMMENT '渠道号',
  `status` int(11) NOT NULL COMMENT '账户状态',
  `settlementtype` varchar(200) NOT NULL,
  `email` varchar(100) NOT NULL,
  `edituserid` varchar(100) DEFAULT NULL COMMENT '编辑人id',
  `authuserid` varchar(100) DEFAULT NULL COMMENT '授权人id',
  PRIMARY KEY (`id`),
  UNIQUE KEY `businessid` (`businessid`) USING BTREE,
  UNIQUE KEY `baemail` (`email`) USING BTREE,
  KEY `bauserid_cons_22` (`userid`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

