  `actamont` decimal(11,2) NOT NULL COMMENT '交易金额',
  `accountdate` varchar(10) NOT NULL,
  `statementdate` varchar(10) NOT NULL COMMENT '会计出账日期',
  `bindaccountdate` varchar(10) NOT NULL COMMENT '会计扎账日期',
  `createdate` varchar(30) NOT NULL COMMENT '订单创建时间',
