  `processdate` varchar(30) DEFAULT NULL COMMENT '订单处理时间',
  `userid` varchar(100) DEFAULT NULL COMMENT '订单处理人id',
  `lastmodifydate` varchar(30) NOT NULL COMMENT '订单最后修改时间',
  `refundamont` decimal(11,2) NOT NULL COMMENT '已退额',
  `refundactamont` decimal(11,2) NOT NULL COMMENT '已退金额',
  `extamont1` decimal(11,2) NOT NULL COMMENT '扩展额1',
  `extamont2` decimal(11,2) NOT NULL COMMENT '扩展额2',
  `extamont3` decimal(11,2) NOT NULL COMMENT '扩展额3',
  `extamont4` decimal(11,2) NOT NULL COMMENT '扩展额4',
  `extamont5` decimal(11,2) NOT NULL COMMENT '扩展额5',
  `extamont6` decimal(11,2) NOT NULL COMMENT '扩展额6',
  `extamont7` decimal(11,2) NOT NULL COMMENT '扩展额7',
  `extamont8` decimal(11,2) NOT NULL COMMENT '扩展额8',
  `extamont9` decimal(11,2) NOT NULL COMMENT '扩展额9',
  `extamont10` decimal(11,2) NOT NULL COMMENT '扩展额10',
  `remark1` text COMMENT '备注1',
  `remark2` text COMMENT '备注2',
  `remark3` text COMMENT '备注3',
  `remark4` text COMMENT '备注4',
  `remark5` text COMMENT '备注5',
  `field1` varchar(100) DEFAULT NULL COMMENT '扩展字段1',
  `field2` varchar(100) DEFAULT NULL COMMENT '扩展字段2',
  `field3` varchar(100) DEFAULT NULL COMMENT '扩展字段3',
  `field4` varchar(100) DEFAULT NULL COMMENT '扩展字段4',
  `field5` varchar(100) DEFAULT NULL COMMENT '扩展字段5',
  `field6` varchar(100) DEFAULT NULL COMMENT '扩展字段6',
  `field7` varchar(100) DEFAULT NULL COMMENT '扩展字段7',
  `field8` varchar(100) DEFAULT NULL COMMENT '扩展字段8',
  `field9` varchar(100) DEFAULT NULL COMMENT '扩展字段9',
  `field10` varchar(100) DEFAULT NULL COMMENT '扩展字段10',
  PRIMARY KEY (`orderNo`),
  KEY `businesstradeno` (`businesstradeno`,`accountdate`) USING BTREE,
  KEY `channel` (`channel`,`accountdate`) USING BTREE,
  KEY `custid` (`custid`,`accountdate`) USING BTREE,
  KEY `status` (`status`,`accountdate`) USING BTREE,
  KEY `createdate` (`accountdate`) USING BTREE,
  KEY `ordertype` (`ordertype`,`status`,`accountdate`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

